INSERT INTO `template_data_13` VALUES (1, '2025-05-08 18:47:02', '2025-05-08 18:47:02', '仪表仪态（15分）', '着装规范（3分）', '严格按照营业厅规定着装，着统一整套（上衣、下装、鞋）制服且保持干净整洁3分，制服有轻微污渍、褶皱、未整套着装、1-2分，未穿制服、着装严重不整洁、鞋子不符合规范严重不整洁0分', '3');
INSERT INTO `template_data_13` VALUES (2, '2025-05-08 18:47:02', '2025-05-08 18:47:02', '仪表仪态（15分）', '发型妆容（4分）', '发型整齐、自然，男士头发不宜过长，女士长发需束起或盘起2分，发型稍显凌乱1分，发型怪异0分', '2');
INSERT INTO `template_data_13` VALUES (3, '2025-05-08 18:47:02', '2025-05-08 18:47:02', '仪表仪态（15分）', '发型妆容（4分）', '女士淡妆上岗，妆容得体，无浓妆艳抹现象2分，淡妆效果一般1分，浓妆、未化妆0分，男士面部保持清洁，无胡须拉碴现象0-2分', '2');
INSERT INTO `template_data_13` VALUES (4, '2025-05-08 18:47:02', '2025-05-08 18:47:02', '仪表仪态（15分）', '姿态规范（8分）', '站立时挺胸抬头，双肩放松，双手自然下垂或交叠于身前，双脚平稳站立，不倚靠他物3-4分，偶尔姿势不标准1-2分，经常姿势不佳0分', '4');
INSERT INTO `template_data_13` VALUES (5, '2025-05-08 18:47:02', '2025-05-08 18:47:02', '仪表仪态（15分）', '姿态规范（8分）', '行走时步伐稳健、轻盈，步幅适中，不奔跑、不拖沓。符合得 2分，偶尔行走姿势不当得1 分，经常行走姿势差得 0 分', '2');
INSERT INTO `template_data_13` VALUES (6, '2025-05-08 18:47:02', '2025-05-08 18:47:02', '仪表仪态（15分）', '姿态规范（8分）', '就座时坐姿端正、不抖腿，坐于椅子的 2/3 处左右。符合得2分，坐姿欠佳得 1分，严重不规范得 0 分', '2');
INSERT INTO `template_data_13` VALUES (7, '2025-05-08 18:47:02', '2025-05-08 18:47:02', '微笑服务（18分）', '嘴角（10分）', '等待、接待客户时，保持微笑，嘴角适度上扬，幅度以露出6 - 8颗上齿，符合得10分，偶尔不符合标准，得5-9分，经常不符合标准3-4分，全程无微笑0-2分', '10');
INSERT INTO `template_data_13` VALUES (8, '2025-05-08 18:47:02', '2025-05-08 18:47:02', '微笑服务（18分）', '眼神（8分）', '接待客户时眼神明亮、专注且友善，与顾客目光接触时，保持平视，眼神中流露出关注和热情得8分，眼神偶尔不关注顾客或眼神热情度不够，得4-7分，眼神不耐烦，经常不关注顾客，得0-3分', '8');
INSERT INTO `template_data_13` VALUES (9, '2025-05-08 18:47:02', '2025-05-08 18:47:02', '语言沟通（10分）', '礼貌用语（5分）', '接待客户时，主动使用 “您好”“请”“谢谢”“对不起”“再见” 等礼貌用语，且使用恰当、自然。符合要求得 3分，偶尔遗漏或使用不自然得2 分，经常不使用得 0 - 1分。', '3');
