INSERT INTO `template_data_13` VALUES (11, '2025-05-08 18:47:02', '2025-05-08 18:47:02', '语言沟通（10分）', '语言禁忌（5分）', '严禁使用粗俗、不文明语言，不使用专业术语让客户费解，除非客户主动询问。未出现得 3分，偶尔出现得 2 分，经常出现得 0 - 1 分', '3');
