INSERT INTO `template_data_13` VALUES (30, '2025-05-08 18:47:02', '2025-05-08 18:47:02', '013721客户关怀（15分）', '第1天', '请问您使用体验如何，有任何疑问可以随时联系我。 温馨提醒您关注新机权益是否已领取， 登录我的**小程序即可查看，购机第二天按标准话术进行回访，得分3分，回访但未按标准话术得1-2分，未回访得0分', '3');
INSERT INTO `template_data_13` VALUES (31, '2025-05-08 18:47:02', '2025-05-08 18:47:02', '013721客户关怀（15分）', '第3天', '鸿蒙手机话术：原生鸿蒙日日新，温馨提醒您可以关注华为应用市场及其应用尝鲜专区，或者我的朋友圈，了解原生鸿蒙软件更新动态。不是鸿蒙手机话术：您好！我是**营业厅给你服务的***，温馨提醒您可以关注**商城，或者我的朋友圈，了解营业厅的各项活动及您的权益，购机第三天按标准话术进行回访，得分3分，回访但未按标准话术得1-2分，未回访得0分，', '3');
INSERT INTO `template_data_13` VALUES (32, '2025-05-08 18:47:02', '2025-05-08 18:47:02', '013721客户关怀（15分）', '第7天', '**强到飞起，为您奉上一些进阶使用技巧和彩蛋。您也可以关注我的朋友圈或**视频号，获取更多精彩内容。购机第7天按标准话术进行回访，得分2分，回访但未按标准话术得1-2分，未回访得0分', '3');
INSERT INTO `template_data_13` VALUES (33, '2025-05-08 18:47:02', '2025-05-08 18:47:02', '013721客户关怀（15分）', '第21天', '请问您近期手机体验如何。如果您在使用过程中有任何问题和疑问，可以随时联系我。如果有相关使用心得，可以参与我们的话题，期待您在圈子里找到相同兴趣的花粉。购机第21天按标准话术进行回访，得分3分，回访但未按标准话术得1-2分，未回访得0分', '3');
INSERT INTO `template_data_13` VALUES (34, '2025-05-08 18:47:02', '2025-05-08 18:47:02', '特殊情况处理（加减分）', '客户不满处理（6分）', '面对客户不满或投诉时，销售人员能保持冷静、耐心倾听，态度诚恳地向客户致歉，并积极采取措施解决问题。符合要求得 3 - 4 分，处理态度较好但解决问题不够得力,得 1-2分，处理不当引发客户更强烈不满扣1-4分', '4');
INSERT INTO `template_data_13` VALUES (35, '2025-05-08 18:47:02', '2025-05-08 18:47:02', '特殊情况处理（加减分）', '客户不满处理（6分）', '能够及时向上级汇报客户重大不满事件，并配合后续处理工作。符合得 2 分，未及时汇报扣 2分', '2');
INSERT INTO `template_data_13` VALUES (36, '2025-05-08 18:47:02', '2025-05-08 18:47:02', '特殊情况处理（加减分）', '突发情况应对（4 分）', '在营业厅遇到停电、设备故障等突发情况时，能迅速做出反应，向客户解释情况，安抚客户情绪，并引导客户采取合理的应对措施。符合要求加 1 - 4 分，应对不够及时或效果不佳扣 1 - 3 分，无应对措施扣4分', '4');
